Hi all, after reviewing the comments and feedback. We do find that we should have kept the community posted with updates in advance. Our sincere apologies.

Solutions:
- With future updates, we will keep the community posted in advance and also provide buffer (Reg off) to update on major updates;
- We also having our new website updated. The website will include regular updates about our solutions;
- The leaderboard will also be upgraded so that miners and validators can easily monitor the performance;
- APIs to the public, this is currently a work in progress item that we think that it would add value to multiple stakeholders at sn32 and broader.

Again, we welcome constructive feedback, our apologies and thank you for your continuous support.

